CREATE TABLE `pinyin` (
  `pinyin_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(8) NOT NULL,
  `pinyin` varchar(16) NOT NULL,
  PRIMARY KEY (`pinyin_id`),
  KEY `title` (`title`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;

